import Particle from './Particle.js';
import imgg from '../imgg.jpg';
import '../../App.css';

export default function About() {

  return (
      <div className="grid grid-cols-2 gap-10">
       <div className='justify-items-center grid grid-rows-3 m-10 gap-10'>
        <h1 className='font-serif lg:text-8xl text-2xl font-extrabold'>
            A Fun And Engaging Test of Memory App
        </h1>
        <p className='text-md'>
            Test your memory skills and cognitive abilities with our app, With ascending difficulty levels and easy-to-use controls, you can tailor the app to your specific needs and goals. 
            <br></br>Enjoy!
        </p>

       </div>
       <img  className="img brightness-75" src={imgg} alt="img"/>
       <Particle />
    </div>
  );
}
